import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
    providedIn: 'root', 
  })
export class DoctorService {
  private backendUrl = 'http://localhost:8080'; // Replace with your backend URL

  constructor(private http: HttpClient) {}

  getPatients() {
    return this.http.get(`${this.backendUrl}/patients`);
  }

  setPrescription(prescriptionData: any) {
    return this.http.post(`${this.backendUrl}/prescription`, prescriptionData);
  }
}
